$AC^2 = AM^2 - BM^2$.

We are given that $AM = 11$ and $AD = 10$. Since $D$ is on $\overline{AM}$, we can find $BM$ by subtracting $AD$ from $AM$:
$BM = AM - AD = 11 - 10 = 1$.

Now we can substitute the values into the equation:
$AC^2 = 11^2 - 1^2 = 121 - 1 = 120$.

Taking the square root of both sides, we get:
$AC = \sqrt{120} = 2\sqrt{30}$.

Since $AB = AC$, we have $AB = 2\sqrt{30}$.

Step 2: Find the length of $BC$.
In right triangle $ABM$, we have $BC^2 = AB^2 - BM^2$.
Substituting the values we found earlier, we get:
$BC^2 = (2\sqrt{30})^2 - 1^2 = 120 - 1 = 119$.

Taking the square root of both sides, we get:
