$Perimeter = AB + AC + BC = 2\sqrt{30} + 2\sqrt{30} + \sqrt{119} = 4\sqrt{30} + \sqrt{119}$.

Therefore, the perimeter of triangle $ABC$ is $\boxed{4\sqrt{30} + \sqrt{119}}$.
The answer is: 4\sqrt{30} + \sqrt{119}.

question:
The following line is parameterized, so that its direction vector is of the form $\begin{pmatrix} -7 \\ b \end{pmatrix}.$  Find $b.$

[asy]
unitsize(0.4 cm);

pair A, B, L, R;
int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

A = (-5,4);
B = (-1,3);
L = extension(A, B, (-8,0), (-8,1));
R = extension(A, B, (8,0), (8,1));

draw(L--R, red);

label("$x$", (8,0), E);
label("$y$", (0,8), N);
[/asy]

